// Core React and style
import React, { Component } from 'react';
import './style.scss';
// Redux
import { connect } from 'react-redux';
import { bindActionCreators } from 'redux';
import { Link } from 'react-router-dom';
import _ from 'lodash';
// Actions
import { fetchAllUsers } from '../../actions/index.js';

class Login extends Component {
  constructor(props) {
    super(props)
  }

  state = {
  }

  fetchAllUsers = () => {
    const endpoint = '/api/v1/frontend/fetch_all_users';
    fetch(endpoint, {
      method: 'GET',
    })
    .then(response => response.json())
    .then(data => {
      this.setState({users: data}, () => {console.log(this.state)})
    })
  }

  componentWillMount() {
    this.fetchAllUsers()
  }

  render() {
    return(
      <div>
        <h1>Th√©</h1>
        <div className="img-container">
          { this.state.users.map((user,index) => { return
            <p key={index+1} >{user.first_name}</p>
          })}
        </div>
      </div>
    )
  }
}

function mapStateToProps(state) {
  return {
    currentUser: state.currentUser
  };
}

function mapDispatchToProps(dispatch) {
  return bindActionCreators({ fetchAllUsers }, dispatch);
}

export default connect(mapStateToProps, mapDispatchToProps)(Login);
